import styled from 'styled-components'

const BlogContainer = styled.div`
  min-height: calc(100vh - 60px);
`

const Blog = () => {
  return (
    <BlogContainer><i class="fas fa-blogger    "></i></BlogContainer>
  )
}

export default Blog
